import React, { Component } from 'react';
import antd,{Carousel} from 'antd';
import '../assets/css/Home.css'
import img from '../static/promo.png'; 
class Home extends Component {
    render() {
        return (
            <Carousel autoplay>
                
                <div>
                
                    
                    <a href="https://freshdesignweb.com">
                        <img src={img}  alt="" title="" hight="100" width ="500"/>
                    </a>

                    <div class="flex-caption">

                        <div class="caption_title_line">
                            <h2>Party Dresses</h2>
                            <p>If you are looking for something a little s collection of stunning party dresses</p>
                        </div>
                    <div/>

                </div>
                </div>  
                <div>
                     <h3>2</h3>
                 </div>
                <div>
                        <h3>3</h3>
                </div>
                 <div>
                        <h3>4</h3>
                </div>
            
            </Carousel>
        );
    }
}

export default Home;
